(17, 1, 1, 'agriculture-in-nepal', '<p>In Nepal, the economy is dominated by agriculture. In the late 1980s, it was the livelihood for more than 90% of the population, although only approximately 20% of the total land area was cultivable, it accounted for, on average, about 60% of the GDP and approximately 75% of exports. Since the formulation of the Fifth Five-Year Plan (1975–80), agriculture has been the highest priority because economic growth was dependent on both increasing the productivity of existing crops and diversifying the agricultural base for use as industrial inputs.</p>'),
(18, 1, 2, 'agriculture-in-nepal', '<p>In Nepal, the economy is dominated by agriculture. In the late 1980s, it was the livelihood for more than 90% of the population, although only approximately 20% of the total land area was cultivable, it accounted for, on average, about 60% of the GDP and approximately 75% of exports. Since the formulation of the Fifth Five-Year Plan (1975–80), agriculture has been the highest priority because economic growth was dependent on both increasing the productivity of existing crops and diversifying the agricultural base for use as industrial inputs.</p>'),
(19, 7, 1, 'agriculture-in-nepal', '<p>In Nepal, the economy is dominated by agriculture. In the late 1980s, it was the livelihood for more than 90% of the population, although only approximately 20% of the total land area was cultivable, it accounted for, on average, about 60% of the GDP and approximately 75% of exports. Since the formulation of the Fifth Five-Year Plan (1975–80), agriculture has been the highest priority because economic growth was dependent on both increasing the productivity of existing crops and diversifying the agricultural base for use as industrial inputs.</p>'),
(20, 7, 2, 'agriculture-in-nepal', '<p>In Nepal, the economy is dominated by agriculture. In the late 1980s, it was the livelihood for more than 90% of the population, although only approximately 20% of the total land area was cultivable, it accounted for, on average, about 60% of the GDP and approximately 75% of exports. Since the formulation of the Fifth Five-Year Plan (1975–80), agriculture has been the highest priority because economic growth was dependent on both increasing the productivity of existing crops and diversifying the agricultural base for use as industrial inputs.</p>'),
(21, 8, 1, 'Organic Farming In Nepal', '<p>Organic farming focuses on utilizing natural materials in agriculture and prohibiting the use of the chemical fertilizers and pesticides which ultimately ruins the fertility of land. Initially, the heavy use of chemical fertilizers increases the production of the land but as time passes the production capacity of land decreases and finally may reach to zero.Organic farming helps to produce safe, nutritious and quality food products together with maintaining ecological balance and its sustainability. International Federation of Organic Agriculture Movements (IFOAM) defines the overarching goal of organic farming as: \"Organic agriculture is a production system that sustains the health of soils, ecosystems and people. It relies on ecological processes, biodiversity and cycles adapted to local conditions, rather than the use of inputs with adverse effects. Organic agriculture combines tradition, innovation and science to benefit the shared environment and promote fair relationships and a good quality of life for all involved...\"</p>'),
(22, 8, 2, 'Organic Farming In Nepal', '<p>Organic farming focuses on utilizing natural materials in agriculture and prohibiting the use of the chemical fertilizers and pesticides which ultimately ruins the fertility of land. Initially, the heavy use of chemical fertilizers increases the production of the land but as time passes the production capacity of land decreases and finally may reach to zero.Organic farming helps to produce safe, nutritious and quality food products together with maintaining ecological balance and its sustainability. International Federation of Organic Agriculture Movements (IFOAM) defines the overarching goal of organic farming as: \"Organic agriculture is a production system that sustains the health of soils, ecosystems and people. It relies on ecological processes, biodiversity and cycles adapted to local conditions, rather than the use of inputs with adverse effects. Organic agriculture combines tradition, innovation and science to benefit the shared environment and promote fair relationships and a good quality of life for all involved...\"</p>'),
(25, 10, 1, 'Modern Day Farming In Nepal', '<p>Today, farming system, modern technology and information are used for the production of the crops and vegetables. In modern farming, farmers have more central roles. Modern day farming has increased the productivity of the cultivable land. Modern day farming helps to maintain the fertility of soil by using machines and technology to create soil conditions appropriate for plant growth with minimal soil loss, drought, insects, diseases and other threats. The use of improved modern genetics for crops and livestock enhances yields, quality and reliability. The attributes of modern day farming are access to effective irrigation, harvesting, handling of storage equipments and techniques to prevent losses.</p>'),
(26, 10, 2, 'Modern Day Farming In Nepal', '<p>Today, farming system, modern technology and information are used for the production of the crops and vegetables. In modern farming, farmers have more central roles. Modern day farming has increased the productivity of the cultivable land. Modern day farming helps to maintain the fertility of soil by using machines and technology to create soil conditions appropriate for plant growth with minimal soil loss, drought, insects, diseases and other threats. The use of improved modern genetics for crops and livestock enhances yields, quality and reliability. The attributes of modern day farming are access to effective irrigation, harvesting, handling of storage equipments and techniques to prevent losses.</p>'),
