(31, 12, 1, 'Nepal Imports 13 Arab 66 Crore value food items', '<p>As per the IRD of&nbsp;Nepal, in last two months of fiscal year 2078/79, total sum of 13 Arab 66 Crore has been spent on importing the food items from international market including India, China,Britain, Spain and other countries.</p><p>The food items include rice, wheat, grain items, fresh fruit and vegetables , meat and diary products worth in crores.</p><p>Although the government claims the self sustainable, the import records show the exact opposite data</p>'),
(32, 12, 2, 'yo nepali ho language', '<p>As per the IRD of&nbsp;Nepal, in last two months of fiscal year 2078/79, total sum of 13 Arab 66 Crore has been spent on importing the food items from international market including India, China,Britain, Spain and other countries.</p><p>The food items include rice, wheat, grain items, fresh fruit and vegetables , meat and diary products worth in crores.</p><p>Although the government claims the self sustainable, the import records show the exact opposite data</p>'),
(33, 9, 1, 'Organic Farming In Nepal', '<p>Organic farming focuses on utilizing natural materials in agriculture and prohibiting the use of the chemical fertilizers and pesticides which ultimately ruins the fertility of land. Initially, the heavy use of chemical fertilizers increases the production of the land but as time passes the production capacity of land decreases and finally may reach to zero.Organic farming helps to produce safe, nutritious and quality food products together with maintaining ecological balance and its sustainability. International Federation of Organic Agriculture Movements (IFOAM) defines the overarching goal of organic farming as: \"Organic agriculture is a production system that sustains the health of soils, ecosystems and people. It relies on ecological processes, biodiversity and cycles adapted to local conditions, rather than the use of inputs with adverse effects. Organic agriculture combines tradition, innovation and science to benefit the shared environment and promote fair relationships and a good quality of life for all involved...\"</p>'),
(34, 9, 2, 'organic-farming-in-nepal', '<p>Organic farming focuses on utilizing natural materials in agriculture and prohibiting the use of the chemical fertilizers and pesticides which ultimately ruins the fertility of land. Initially, the heavy use of chemical fertilizers increases the production of the land but as time passes the production capacity of land decreases and finally may reach to zero.Organic farming helps to produce safe, nutritious and quality food products together with maintaining ecological balance and its sustainability. International Federation of Organic Agriculture Movements (IFOAM) defines the overarching goal of organic farming as: \"Organic agriculture is a production system that sustains the health of soils, ecosystems and people. It relies on ecological processes, biodiversity and cycles adapted to local conditions, rather than the use of inputs with adverse effects. Organic agriculture combines tradition, innovation and science to benefit the shared environment and promote fair relationships and a good quality of life for all involved...\"</p>'),
(39, 16, 1, 'Steel Cook muni', '<p>Est necessitatibus u muni</p>');
