INSERT INTO `page_detail` (`id`, `title`, `description`, `language_id`, `page_id`, `created_at`, `updated_at`) VALUES
(9, 'About Us', '<h1><strong>Introduction&nbsp;</strong></h1><p><strong>Urbar Nepal Public Limited</strong>&nbsp;is a public company&nbsp;formed by collective and synergic effort between self-sustained economy campaigner and primary producers specifically: farmers, milk producers, fishermen, and other production based small scale industry owners.</p><p>Urbar Nepal public limited can be termed as a producer company and a legal corporation which provides for sharing of profits/benefits among the members.</p><p><br></p><p>Urbar Bazaar is the&nbsp;marketplace&nbsp;of Urbar Nepal Public Limited that will operate in Offline/Online model and established&nbsp;with a vision to market the products of our farmers and manfacturers , Urbar Bazaar will work to support and promote the local produced goods with a motive to reduce the dependency upon the foreign products and raise the national economy by exporting different products to the international market..</p><h1><strong>Our Mission</strong></h1><p>Promote sustainable and equitable agriculture and rural prosperity through effective credit support, related services like subsidized inputs (seeds, fertilizers, and machinery) via institution development and innovative initiatives,market solution and problem-solving approach and collective production.</p><p>To ensure better income for the producers through an organization of their own. Small producers do not have the volume individually (both inputs and produce) to get the benefit of economies of scale. Besides, in agricultural marketing, there is a long chain of intermediaries who very often work non-transparently leading to the situation where the producer receives only a small part of the value that the ultimate consumer pays. Through aggregation, the primary producers can avail the benefit of economies of scale. They will also have better bargaining power via the bulk buyers of produce and bulk suppliers of inputs.</p><p><br></p>', 1, 1, '2021-12-02 08:55:32', NULL),
(10, 'About Us', '<h1><strong>Introduction&nbsp;</strong></h1><p><strong>Urbar Nepal Public Limited</strong>&nbsp;is a public company&nbsp;formed by collective and synergic effort between self-sustained economy campaigner and primary producers specifically: farmers, milk producers, fishermen, and other production based small scale industry owners.</p><p>Urbar Nepal public limited can be termed as a producer company and a legal corporation which provides for sharing of profits/benefits among the members.</p><p><br></p><p>Urbar Bazaar is the&nbsp;marketplace&nbsp;of Urbar Nepal Public Limited that will operate in Offline/Online model and established&nbsp;with a vision to market the products of our farmers and manfacturers , Urbar Bazaar will work to support and promote the local produced goods with a motive to reduce the dependency upon the foreign products and raise the national economy by exporting different products to the international market..</p><h1><strong>Our Mission</strong></h1><p>Promote sustainable and equitable agriculture and rural prosperity through effective credit support, related services like subsidized inputs (seeds, fertilizers, and machinery) via institution development and innovative initiatives,market solution and problem-solving approach and collective production.</p><p>To ensure better income for the producers through an organization of their own. Small producers do not have the volume individually (both inputs and produce) to get the benefit of economies of scale. Besides, in agricultural marketing, there is a long chain of intermediaries who very often work non-transparently leading to the situation where the producer receives only a small part of the value that the ultimate consumer pays. Through aggregation, the primary producers can avail the benefit of economies of scale. They will also have better bargaining power via the bulk buyers of produce and bulk suppliers of inputs.</p><p><br></p>', 2, 1, '2021-12-03 08:55:42', NULL),
(11, 'Refund Policy', '<p><strong>Return &amp; Refund Policy</strong></p><p><strong>Returns are the provision by the sellers under different category where the option of return &amp; refund is provided to you by the respective sellers. The return policy may not be the same for all the products under a different product category.&nbsp;&nbsp;The product which is under the warranty period will be redirected to the service center, return &amp; refund policies will not be eligible for such products.&nbsp;You can refer to the product page for the applicable return policy.&nbsp;</strong></p><p><strong>Valid reasons to return an item&nbsp;</strong></p><ol><li><strong>If the Delivered Product is damaged/defective (physically damaged or rotten)</strong></li><li><br></li><li><strong>If the&nbsp;Delivered Product is incorrect/incomplete&nbsp;(missing product or wrong product/ different from the product presented on website)&nbsp;</strong></li><li><br></li><li><strong>&nbsp;If the delivered product is no longer needed. (you have changed your mind about the purchase/ you do not like the product after delivery)-eligible for selected products only.&nbsp;</strong></li></ol><p><strong>&nbsp;</strong></p><p><strong>Return cycle &amp; Pickup period&nbsp;</strong></p><p><strong>The return request must be initiated within 7 days of product return cycle and for damaged/defective products the return request must be initiated within 3 days of receiving the product. After the return request is accepted, product is picked within 3 days after the return request is accepted for inside valley. For outside valley the period may extend to 7 days. After the item has been picked up&nbsp;Urbarbazaar&nbsp;will quality check the product and based on the outcome will be processed for refund or notifying the customer on any issue encountered.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Returns Pick-Up and Processing&nbsp;</strong></p><p><strong>For returns, the address can only be changed if the&nbsp;pick up&nbsp;service is available at the new address.&nbsp;</strong></p><p><strong>During pick-up, your product will be checked for the following conditions:&nbsp;</strong></p><p><strong>Category&nbsp;</strong></p><p><strong>Condition&nbsp;</strong></p><p><strong>Correct Product&nbsp;</strong></p><p><strong>Product name/ image/ brand/ serial number/ article number/ bar code should match and MRP tag should be undetached and clearly visible.&nbsp;</strong></p><p>&nbsp;&nbsp;<strong>Unused Product&nbsp;</strong></p><p><strong>The product should be unused, unwashed, unsoiled, without any stains.</strong></p><p><strong>Undamaged Product&nbsp;</strong></p><p><strong>No any physical damage/ no any physical deformation of the product/ there should not be scratches/ the perishable goods should not be damaged/ no any tears or holes in any kind of fabric materials/ no any crack is breakage in any&nbsp;glasswares&nbsp;and transparent plastic materials or PVA plastic/ no any wires disconnections/ the electronic product should be functioning.&nbsp;</strong></p><p><strong>Undamaged Packaging&nbsp;</strong></p><p><strong>Product\'s original packaging/ box should be undamaged/the cover should not be tore/ the labelling and price tags should remain as it was before.&nbsp;</strong></p><p><strong>VAT/PAN Bill&nbsp;</strong></p><p><strong>Product should be returned with VAT/ PAN bill if provided by the vendor.&nbsp;</strong></p><p><strong>The field executive has the right to refuse to accept the return if any of the above conditions are not met.&nbsp;</strong></p><p><strong>The refund will be processed once the product is picked and quality checked by&nbsp;Urbarbazaar.com&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Refund&nbsp;</strong></p><p><strong>The refund will be processed after the product is picked and quality checked by the QC Team. The refund time depends on the payment method which is mentioned below.&nbsp;</strong></p><p><strong>Payment Method&nbsp;</strong></p><p><strong>Refund Option&nbsp;</strong></p><p><strong>Refund Time&nbsp;</strong></p><p><strong>Cash on Delivery (CoD)&nbsp;</strong></p><p><strong>Bank Deposit&nbsp;</strong></p><p><strong>4-5 working days&nbsp;</strong></p><p><strong>Urbarbazaar&nbsp;Voucher&nbsp;</strong></p><p><strong>Voucher&nbsp;</strong></p><p><strong>1-2 working days&nbsp;</strong></p><p><strong>Card Payment&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Pay with VISA &amp; Mastercard</strong></p><p><strong>To be credited to card&nbsp;</strong></p><p><strong>7 working days</strong></p><p><strong>Credit Card&nbsp;</strong></p><p><strong>To be credited to card&nbsp;</strong></p><p><strong>7 working days&nbsp;</strong></p><p><strong>Esewa&nbsp;&nbsp;</strong></p><p><strong>To be credited in respective account&nbsp;</strong></p><p><strong>1-2 working days&nbsp;</strong></p><p><strong>IME Pay</strong></p><p><strong>To be credited in respective account&nbsp;</strong></p><p><strong>1-2 working days</strong></p><p><strong>Khalti</strong></p><p><strong>To be credited in respective account</strong></p><p><strong>1-2 working days</strong></p><p><strong>&nbsp;</strong></p><p><strong>Shipping charge refund&nbsp;</strong></p><ul><li><strong>If the refund is initiated due to “no longer needed”&nbsp;-then the shipping charge will not be refunded&nbsp;</strong></li><li><br></li><li><strong>If the refund is initiated due to wrong/defective/damaged/quality issue&nbsp;then the shipping charge will be refunded.&nbsp;</strong></li></ul><p><br></p>', 1, 2, NULL, NULL),
