(13, 'Privacy Policy', '<p><strong>This Privacy Policy describes how your personal information is collected, used, and shared when you visit or make a purchase from&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>www.urbarbazaar.com</strong></a><strong>&nbsp;(Urbar Nepal Public Limited).</strong></p><p><strong>&nbsp;</strong></p><p><strong>PERSONAL INFORMATION WE COLLECT&nbsp;</strong></p><p><strong>When you visit the Site, we automatically collect certain information about your device, including information about your web browser, IP address, time zone, and some of the cookies that are installed on your device. Additionally, as you browse the Site, we collect information about the individual web pages or products that you view, what websites or search terms referred you to the Site, and information about how you interact with the Site. We refer to this automatically collected information as “Device Information”.&nbsp;</strong></p><p><strong>We collect Device Information using the following technologies:&nbsp;</strong></p><p><strong>&nbsp;&nbsp;&nbsp;- “Cookies” are data files that are placed on your device or computer and often include an anonymous unique identifier. For more information about cookies, and how to disable cookies, visit&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>http://www.allaboutcookies.org</strong></a><strong>.&nbsp;</strong></p><p><strong>Additionally, when you make a purchase or attempt to make a purchase through the Site, we collect certain information from you, including your name, billing address, shipping address, payment information, email address, and phone number.&nbsp;We refer to this information as “Order Information”.&nbsp;</strong></p><p><strong>When we talk about “Personal Information” in this Privacy Policy, we are talking both about Device Information and Order Information.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>HOW DO WE USE YOUR PERSONAL INFORMATION?&nbsp;</strong></p><p><strong>We use the Order Information that we collect generally to fulfill any orders placed through the Site (including processing your payment information, arranging for shipping, and providing you with invoices and/or order confirmations).&nbsp;Additionally, we use this Order Information to:&nbsp;</strong></p><ol><li><strong>Communicate with you;&nbsp;</strong></li><li><br></li><li><strong>Screen our orders for potential risk or fraud; and&nbsp;</strong></li><li><br></li><li><strong>When in line with the preferences you have shared with us, provide you with information or advertising relating to our products or services.&nbsp;</strong></li></ol><p><strong>We use the Device Information that we collect to help us screen for potential risk and fraud (in particular, your IP address), and more generally to improve and optimize our Site (for example, by generating analytics about how our customers browse and interact with the Site, and to assess the success of our marketing and advertising campaigns).&nbsp;&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p>&nbsp;</p><p><strong>SHARING YOUR PERSONAL INFORMATION&nbsp;</strong></p><p><strong>We share your Personal Information with third parties to help us use your Personal Information, as described above.&nbsp;&nbsp;For example, we may use third parties to assist us with delivering products to you, to help us to collect payments from you, to analyze data and to provide us with marketing or customer service assistance.&nbsp;We also use Google Analytics to help us understand how our customers use the Site--you can read more about how Google uses your Personal Information here:&nbsp;&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://www.google.com/intl/en/policies/privacy/</strong></a><strong>.&nbsp;You can also opt-out of Google Analytics here:&nbsp;&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://tools.google.com/dlpage/gaoptout</strong></a><strong>.&nbsp;</strong></p><p><strong>We may exchange information with third parties for the purposes of fraud protection and credit risk reduction in accordance with the provisions of the Electronic Transaction Act 2063 (2008). We may transfer our databases containing your personal information if we sell our business or part of it. Other than as set out in this Privacy Policy, we shall&nbsp;NOT&nbsp;sell or disclose your personal data to third parties without obtaining your prior consent unless this is necessary for the purposes set out in this Privacy Policy or unless we are required to do so by the prevailing law. The Site may contain advertising of third parties and links to other sites or frames of other sites. Please be aware that we are not responsible for the privacy practices or content of those third parties or other sites, nor for any third party to whom we transfer your data in accordance with our Privacy Policy. You are responsible for protecting against unauthorized access to your&nbsp;Urbar&nbsp;Bazaar account, password and to your computer.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>BEHAVIOURAL ADVERTISING&nbsp;</strong></p><p><strong>As described above, we use your Personal Information to provide you with targeted advertisements or marketing communications we believe may be of interest to you.&nbsp;For more information about how targeted advertising works, you can visit the Network Advertising Initiative’s (“NAI”) educational page at&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>http://www.networkadvertising.org/understanding-online-advertising/how-does-it-work</strong></a><strong>.&nbsp;</strong></p><p><strong>You can opt out of targeted advertising by:&nbsp;</strong></p><p><strong>&nbsp;INCLUDE OPT-OUT LINKS FROM WHICHEVER SERVICES BEING USED.&nbsp;</strong></p><p><strong>&nbsp;COMMON LINKS INCLUDE:&nbsp;</strong></p><p><strong>&nbsp;&nbsp;&nbsp;FACEBOOK -&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://www.facebook.com/urbarnepal/</strong></a></p><p><strong>&nbsp;&nbsp;&nbsp;GOOGLE -&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://www.google.com/settings/ads/anonymous</strong></a><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>DO NOT TRACK&nbsp;</strong></p><p><strong>Please note that we do not alter our Site’s data collection and use practices when we see a Do Not Track signal from your browser.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>YOUR RIGHTS&nbsp;</strong></p><p><strong>As per Chapter 10 of Privacy Act 2075 (2018) (Collection &amp; Protection of Personal Information), you have the right to access personal information we hold about you and to ask that your personal information be corrected, updated, or deleted. If you would like to exercise this right, please contact us through the contact information below.&nbsp;At any stage you also have the right to ask us to stop using your personal data for direct marketing purposes as per chapter 6 of the&nbsp;Privacy Act 2075 (2018) (Privacy Relating to Data).&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>DATA RETENTION&nbsp;</strong></p><p><strong>When you place an order through the Site, we will maintain your Order Information for our records unless and until you ask us to delete this information.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;AGE ELIGIBILITY&nbsp;</strong></p><p><strong>The Site is not intended for individuals under the age of 18,&nbsp;of unsound mind or with intellectual disability.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>CHANGES&nbsp;</strong></p><p><strong>We may update this privacy policy from time to time in order to reflect, for example, changes to our practices or for other operational, legal or regulatory reasons.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>CONTACT US&nbsp;</strong></p><p><strong>For more information about our privacy practices, if you have questions, or if you would like to make a complaint, please contact us by e-mail at&nbsp;info@</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>Urbarbazaar.com&nbsp;</strong></a><strong>or call us at&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>01-5907270</strong></a><strong>&nbsp;</strong></p><p><strong>&nbsp;&nbsp;</strong></p><p><strong>Note: Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.&nbsp;</strong></p>', 1, 3, NULL, NULL),
(14, 'Privacy Policy', '<p><strong>This Privacy Policy describes how your personal information is collected, used, and shared when you visit or make a purchase from&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>www.urbarbazaar.com</strong></a><strong>&nbsp;(Urbar Nepal Public Limited).</strong></p><p><strong>&nbsp;</strong></p><p><strong>PERSONAL INFORMATION WE COLLECT&nbsp;</strong></p><p><strong>When you visit the Site, we automatically collect certain information about your device, including information about your web browser, IP address, time zone, and some of the cookies that are installed on your device. Additionally, as you browse the Site, we collect information about the individual web pages or products that you view, what websites or search terms referred you to the Site, and information about how you interact with the Site. We refer to this automatically collected information as “Device Information”.&nbsp;</strong></p><p><strong>We collect Device Information using the following technologies:&nbsp;</strong></p><p><strong>&nbsp;&nbsp;&nbsp;- “Cookies” are data files that are placed on your device or computer and often include an anonymous unique identifier. For more information about cookies, and how to disable cookies, visit&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>http://www.allaboutcookies.org</strong></a><strong>.&nbsp;</strong></p><p><strong>Additionally, when you make a purchase or attempt to make a purchase through the Site, we collect certain information from you, including your name, billing address, shipping address, payment information, email address, and phone number.&nbsp;We refer to this information as “Order Information”.&nbsp;</strong></p><p><strong>When we talk about “Personal Information” in this Privacy Policy, we are talking both about Device Information and Order Information.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>HOW DO WE USE YOUR PERSONAL INFORMATION?&nbsp;</strong></p><p><strong>We use the Order Information that we collect generally to fulfill any orders placed through the Site (including processing your payment information, arranging for shipping, and providing you with invoices and/or order confirmations).&nbsp;Additionally, we use this Order Information to:&nbsp;</strong></p><ol><li><strong>Communicate with you;&nbsp;</strong></li><li><br></li><li><strong>Screen our orders for potential risk or fraud; and&nbsp;</strong></li><li><br></li><li><strong>When in line with the preferences you have shared with us, provide you with information or advertising relating to our products or services.&nbsp;</strong></li></ol><p><strong>We use the Device Information that we collect to help us screen for potential risk and fraud (in particular, your IP address), and more generally to improve and optimize our Site (for example, by generating analytics about how our customers browse and interact with the Site, and to assess the success of our marketing and advertising campaigns).&nbsp;&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p>&nbsp;</p><p><strong>SHARING YOUR PERSONAL INFORMATION&nbsp;</strong></p><p><strong>We share your Personal Information with third parties to help us use your Personal Information, as described above.&nbsp;&nbsp;For example, we may use third parties to assist us with delivering products to you, to help us to collect payments from you, to analyze data and to provide us with marketing or customer service assistance.&nbsp;We also use Google Analytics to help us understand how our customers use the Site--you can read more about how Google uses your Personal Information here:&nbsp;&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://www.google.com/intl/en/policies/privacy/</strong></a><strong>.&nbsp;You can also opt-out of Google Analytics here:&nbsp;&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://tools.google.com/dlpage/gaoptout</strong></a><strong>.&nbsp;</strong></p><p><strong>We may exchange information with third parties for the purposes of fraud protection and credit risk reduction in accordance with the provisions of the Electronic Transaction Act 2063 (2008). We may transfer our databases containing your personal information if we sell our business or part of it. Other than as set out in this Privacy Policy, we shall&nbsp;NOT&nbsp;sell or disclose your personal data to third parties without obtaining your prior consent unless this is necessary for the purposes set out in this Privacy Policy or unless we are required to do so by the prevailing law. The Site may contain advertising of third parties and links to other sites or frames of other sites. Please be aware that we are not responsible for the privacy practices or content of those third parties or other sites, nor for any third party to whom we transfer your data in accordance with our Privacy Policy. You are responsible for protecting against unauthorized access to your&nbsp;Urbar&nbsp;Bazaar account, password and to your computer.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>BEHAVIOURAL ADVERTISING&nbsp;</strong></p><p><strong>As described above, we use your Personal Information to provide you with targeted advertisements or marketing communications we believe may be of interest to you.&nbsp;For more information about how targeted advertising works, you can visit the Network Advertising Initiative’s (“NAI”) educational page at&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>http://www.networkadvertising.org/understanding-online-advertising/how-does-it-work</strong></a><strong>.&nbsp;</strong></p><p><strong>You can opt out of targeted advertising by:&nbsp;</strong></p><p><strong>&nbsp;INCLUDE OPT-OUT LINKS FROM WHICHEVER SERVICES BEING USED.&nbsp;</strong></p><p><strong>&nbsp;COMMON LINKS INCLUDE:&nbsp;</strong></p><p><strong>&nbsp;&nbsp;&nbsp;FACEBOOK -&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://www.facebook.com/urbarnepal/</strong></a></p><p><strong>&nbsp;&nbsp;&nbsp;GOOGLE -&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://www.google.com/settings/ads/anonymous</strong></a><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>DO NOT TRACK&nbsp;</strong></p><p><strong>Please note that we do not alter our Site’s data collection and use practices when we see a Do Not Track signal from your browser.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>YOUR RIGHTS&nbsp;</strong></p><p><strong>As per Chapter 10 of Privacy Act 2075 (2018) (Collection &amp; Protection of Personal Information), you have the right to access personal information we hold about you and to ask that your personal information be corrected, updated, or deleted. If you would like to exercise this right, please contact us through the contact information below.&nbsp;At any stage you also have the right to ask us to stop using your personal data for direct marketing purposes as per chapter 6 of the&nbsp;Privacy Act 2075 (2018) (Privacy Relating to Data).&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>DATA RETENTION&nbsp;</strong></p><p><strong>When you place an order through the Site, we will maintain your Order Information for our records unless and until you ask us to delete this information.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;AGE ELIGIBILITY&nbsp;</strong></p><p><strong>The Site is not intended for individuals under the age of 18,&nbsp;of unsound mind or with intellectual disability.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>CHANGES&nbsp;</strong></p><p><strong>We may update this privacy policy from time to time in order to reflect, for example, changes to our practices or for other operational, legal or regulatory reasons.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>CONTACT US&nbsp;</strong></p><p><strong>For more information about our privacy practices, if you have questions, or if you would like to make a complaint, please contact us by e-mail at&nbsp;info@</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>Urbarbazaar.com&nbsp;</strong></a><strong>or call us at&nbsp;</strong><a href=\"https://urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>01-5907270</strong></a><strong>&nbsp;</strong></p><p><strong>&nbsp;&nbsp;</strong></p><p><strong>Note: Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.&nbsp;</strong></p>', 2, 3, NULL, NULL);
