(15, 'Terms and Conditions', '<p><strong>TERMS AND CONDITIONS</strong></p><p><strong>Terms of Service/Use (ToS)</strong></p><p><strong>&nbsp;</strong></p><p><strong>Welcome to urbarbazaar.com. Please read the Terms of Use carefully before using the website.</strong></p><p><strong>&nbsp;</strong></p><p><strong>Terms and conditions/Terms of Use</strong></p><p><strong>These terms and conditions (\"Agreement\") set forth the general terms and conditions of your use of the&nbsp;</strong><a href=\"http://www.urbarbazaar.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>urbarbazaar.com&nbsp;</strong></a><strong>website (\"Website\"), \"Urbarbazaar\" mobile application (\"Mobile Application\") and any of the related products and services (collectively, \"Services\"). This Agreement is legally binding between you (\"User, you, your\") and Urbar Nepal Public Limited (, \"Urbarbazaar, we, us\"). By accessing and using the Services, you acknowledge that you have read, understood, and agree to be bound by the terms of this Agreement and You accept and&nbsp;agree to these terms and conditions and the revisions henceforth. You also&nbsp;accept and agree to be bound by Urbarbazaar Policies set out in the website and as amended&nbsp;from time to time. If you choose not to agree with any of these terms, you may stop using the Services immediately. Subject to You complying with these Terms of Use, we grant&nbsp;you a personal, non-exclusive, non-transferable, limited privilege to enter and&nbsp;use the Website. If you are entering into this Agreement on behalf of a business or other legal entity, you represent that you have the authority to bind such entity to this Agreement, in which case the terms \"User\" and “you/your” shall refer to such entity. You acknowledge that this Agreement is a contract between you and the Urbarbazaar, even though it is electronic and is not physically signed by you, and it governs your use of the Services, creating a binding obligation for you.</strong></p><p><strong>&nbsp;</strong></p><p><strong>Access</strong></p><p><strong>Urbarbazaar will make best effort to make the services available without any disruptions but there might be down times wherein Urbarbazaar shall not take any responsibility. Additionally, Urbarbazaar can block access to user if certain violation or trigger events occur.</strong></p><p><strong>&nbsp;</strong></p><p><strong>Submissions</strong></p><p><strong>Any comments, reviews, submissions that you may submit will be public. Additionally, reviews and submission can only be submitted by genuine purchaser and without using profanity (and have similar restriction in place) including complying with other terms of this agreement; and Urbarbazaar can take them down if it violates any law or this terms or rights of other people.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Platform</strong></p><p><strong>Urbarbazaar provides Service as a platform where Users can carry out transaction directly from the Urbar Nepal Public Limited store (</strong><a href=\"https://www.urbarbazaar.com/shop\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://www.urbarbazaar.com/shop</strong></a><strong>). You agree and acknowledge that you are using the Service and carrying out any transaction at your own risk, and you have used your prudent and careful judgment while making the decision to carry out any transaction.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Urbarbazaar at any point of time during any transaction between Buyer&nbsp;and Seller (Urbar Nepal) on the Website accept any responsibility or liability for any representation, warranty made by seller (Urbar Nepal) in its listing or any other action or inaction by seller, including delay in delivery.</strong></p><p><strong>&nbsp;</strong></p><p><strong>Urbarbazaar is responsible for delayed performance of services&nbsp;or damages or delays as a result of products which are out of stock or unavailable. Urbarbazaar hereby disclaims any obligations or liabilities in the respect.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Accounts and membership</strong></p><p><strong>You must be at least 18 years of age to use the Services herein. However, if you are below the age of 18 years, you should immediately terminate the use of this website or application. By using the Services and by agreeing to this Agreement you warrant and represent that you are at least 18 years of age. If you create an account on the Services, you are responsible for maintaining the security of your account and you are fully responsible for all activities that occur under the account and any other actions taken in connection with it. We may monitor and review new accounts before you may sign in and start using the Services. You must immediately notify us of any unauthorized uses of your account or any other breaches of security. We will not be liable for any acts or omissions by you, including any damages of any kind incurred as a result of such acts or omissions. We may suspend, disable, or delete your account (or any part thereof) if we determine that you have violated any provision of this Agreement or that your conduct or content would tend to damage our reputation and goodwill.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>User content</strong></p><p><strong>We do not own any data, information or material (collectively, \"Content\") that you submit on the Services in the course of using the Service. You shall have sole responsibility for the accuracy, quality, integrity, legality, reliability, appropriateness, and intellectual property ownership or right to use of all submitted Content. We may monitor and review the Content on the Services submitted or created using our Services by you. You grant us permission to access, copy, distribute, store, transmit, reformat, display and perform the Content of your user account solely as required for the purpose of providing the Services to you. Without limiting any of those representations or warranties, we have the right, though not the obligation, to, in our own sole discretion, refuse or remove any Content that, in our reasonable opinion, violates any of our policies or is in any way harmful or objectionable. You also grant us the license to use, reproduce, adapt, modify, publish or distribute the Content to a third-party created by you or stored in your user account for commercial, marketing or any similar purpose.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Backups</strong></p><p><strong>Regular backups of the Website and its content is done by us, however, these backups are for our own organizational purposes only and are not guaranteed in any manner. You are responsible for maintaining your own backups of your data. We do not provide any sort of compensation for lost or incomplete data in the event that backups do not function properly.</strong></p><p><strong>&nbsp;</strong></p><p>&nbsp;</p><p><strong>Prohibited uses</strong></p><p><strong>In addition to other terms as set forth in the Agreement, you are barred from using the Services or Content: (a) for any unlawful act; (b) to instigate others to perform or partake in any unlawful acts; (c) to violate any international, national, provincial regulations, rules, laws, or local ordinances; (d) to infringe upon or violate our intellectual property rights or the intellectual property rights of others; (e) to harass, abuse, insult, harm, defame, slander, disparage, intimidate, or discriminate in any manner, or disability; (f) to upload counterfeited, wrong or misleading information; (g) to upload or transfer viruses or any other type of malware that will or may be used in any way that will disrupt the functionality or smooth operation of the Services including third party products and services, or the Internet; (h) for any obscene or immoral purpose; or (i) to interfere with or circumvent the security features of the Services, third party products and services, or the Internet. We reserve the right to terminate your use of the Services for violating any of the prohibited uses. If any liability arises due to the above-mentioned reasons, then the user agrees to take full responsibility.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Intellectual property rights</strong></p><p><strong>\"Intellectual Property Rights\" means all present and future rights conferred by law or equity in or in relation to any copyright and related rights, trademarks, designs, patents, inventions, goodwill and the right to sue for passing off, rights to inventions, rights to use, and all other intellectual property rights, in each case whether registered or unregistered and including all applications and rights to apply for and be granted, rights to claim priority from, such rights and all similar or equivalent rights or forms of protection and any other results of intellectual activity which subsist or will subsist now or in the future in any part of the world. This Agreement does not transfer to you any intellectual property owned by&nbsp;Urbarbazaar or third parties, and all rights, titles, and interests in and to such property will remain (as between the parties) solely with Urbar Nepal. All trademarks, service marks, graphics and logos used in connection with the Services, are trademarks or registered trademarks of&nbsp;Urbar Nepal Public Limited or its licensors. Other trademarks, service marks, graphics and logos used in connection with the Services may be the trademarks of other third parties. Your use of the Services grants you no right or license to reproduce or otherwise use any of the Urbarbazaar or third party Intellectual property.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Limitation of liability</strong></p><p><strong>To the extent permitted by applicable law, in no event will Urbarbazaar, its affiliates, directors, officers, employees, agents, suppliers or licensors be liable to any person for any indirect, incidental, special, punitive, cover or consequential damages (including, without limitation, damages for lost profits, revenue, sales, goodwill, use of content, impact on business, business interruption, loss of anticipated savings, loss of business opportunity) however caused, under any theory of liability, including, without limitation, contract, tort, warranty, breach of statutory duty, negligence or otherwise.&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Product Description</strong></p><p><strong>Urbarbazaar does not warrant that Product description or other content of this&nbsp;Website is accurate, complete, reliable, current, or error-free and assumes no&nbsp;liability in this regard.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Indemnification</strong></p><p><strong>You agree to indemnify and hold the Urbarbazaar and its affiliates, directors, officers, employees, agents, suppliers and licensors harmless from and against any liabilities, losses, damages or costs, including reasonable lawyers\' fees, incurred in connection with or arising from any third party allegations, claims, actions, disputes, or demands asserted against any of them as a result of or relating to your Content, your use of the Services or any willful misconduct on your part.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Severability</strong></p><p><strong>All rights and restrictions contained in this Agreement may be exercised and shall be applicable and binding only to the extent that they do not violate any applicable laws and are intended to be limited to the extent necessary so that they will not render this Agreement illegal, invalid or unenforceable. If any provision or portion of any provision of this Agreement shall be held to be illegal, invalid or unenforceable by a court of competent jurisdiction, it is the intention of the parties that the remaining provisions or portions thereof shall constitute their agreement with respect to the subject matter hereof, and all such remaining provisions or portions thereof shall remain in full force and effect.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Dispute resolution</strong></p><p><strong>In case of any dispute, the first recourse of Urbarbazaar shall be to take-down any violating, counterfeited contents, or make arrangement for User to return product as per “Return &amp; Refund Policy” of the website as soon as such information is brought to the knowledge of Urbarbazaar. Any dispute, claim, or difference shall be settled amicably.</strong></p><p><strong>&nbsp;</strong></p><p><strong>Following the failure to settle the disputes amicably within ninety (90) days, shall be governed by the substantive and procedural laws of Nepal without regard to its rules on conflicts or choice of law and, to the extent applicable, the laws of Nepal. Each party irrevocably agrees that any dispute in connection be settled by Arbitration in accordance with UNCITRAL Arbitration Rules for the time being in force, and administered by NEPCA in the following manner:</strong></p><p><strong>&nbsp;</strong></p><ol><li><strong>The number of arbitrators shall be three (3). The arbitrator shall not be a present or former employee, agent, consultant or advisor of the parties or their affiliates.</strong></li><li><br></li><li><strong>Each Party shall appoint a one arbitrator and the arbitrators appointed by the Parties shall appoint a third arbitrator who shall ne the chairperson of the arbitral tribunal.</strong></li><li><br></li><li><strong>If a party fails to appoint an arbitrator or the arbitrators appointed fail to choose a third arbitrator, such arbitrator shall be appointed by NEPCA, failing which shall be appointed in accordance with the laws of Nepal.</strong></li><li><br></li><li><strong>Venue and seat of the arbitration shall be Kathmandu, Nepal.</strong></li><li><br></li><li><strong>The decision of the arbitration shall specify how the expenses of the arbitration shall be allocated between the parties.</strong></li><li><br></li><li><strong>The arbitration award shall be final and binding upon the parties, and decree on such award may be entered in any court having jurisdiction.</strong></li></ol><p><strong>&nbsp;</strong></p><p><strong>Notwithstanding anything mentioned elsewhere in this document, the parties shall have the right to seek injunctive or equitable relief available under applicable laws from the competent courts of Nepal having jurisdiction on the matter thereof.</strong></p><p><strong>&nbsp;</strong></p><p><strong>Changes and amendments</strong></p><p><strong>Urbarbazaar may modify these terms of use relating to the Services at any time, providing an advance notice along with updated version of this agreement. If the terms are modified, the changes will be effective on the date stated in the advance notice. It is Your responsibility to&nbsp;review these Terms and Conditions periodically for updates / changes. If you disagree with any updated version of this agreement, you may stop using the Service immediately. A continued use of the Services after any such changes shall constitute your consent to such changes.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Acceptance of these terms</strong></p><p><strong>You acknowledge that you have read these terms of use and agree to all its terms and conditions. This is by accessing and using the Services you agree to be bound by this Agreement. This agreement is an electronic record as per&nbsp;Rule 3 of the Electronic Transaction Rules, 2064. If you do not agree to abide by the terms of this Agreement, you are not authorized to access or use the Services.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Contacting us</strong></p><p><strong>You may contact us via contact form of our website or write a letter to Mahadevsthan Marga, Mid Baneswor, Kathmandu, Nepal. When You use the Website or send emails or other data, information or&nbsp;communication to us, You agree and understand that You are communicating&nbsp;with Us through electronic records and You consent to receive communications&nbsp;via electronic records from Us periodically and as and when required. We may&nbsp;communicate with you by email or by such other mode of communication,&nbsp;electronic or otherwise.</strong></p><p><strong>&nbsp;</strong></p><p><strong>Website Disclaimer</strong></p><p><strong>The information provided by Urbarbazaar on&nbsp;</strong><a href=\"https://www.urbarbazaar.com/%C2%A0\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\"><strong>https://www.urbarbazaar.com/&nbsp;</strong></a><strong>and our mobile applications is for general informational purposes only. All information on the Site and our mobile applications is provided in good faith, however we make no representation or warranty of any kind, express or implied, regarding the accuracy, adequacy, validity, reliability, availability or completeness of any information on the Site or our mobile application. UNDER NO CIRCUMSTANCE SHALL WE HAVE ANY LIABILITY TO YOU FOR ANY LOSS OR DAMAGE OF ANY KIND INCURRED AS A RESULT OF THE USE OF THE SITE OR OUR MOBILE APPLICATIONS OR RELIANCE ON ANY INFORMATION PROVIDED ON THE SITE AND OUR MOBILE APPLICATION. YOUR USE OF AND RELIANCE ON THE SITE AND OUR MOBILE APPLICATIONS AND ANY INFORMATION ON THE SITE AND OUR MOBILE APPLICATION IS SOLELY AT YOUR OWN RISK.</strong></p><p><strong>&nbsp;</strong></p><p><strong>External Links Disclaimer</strong></p><p><strong>The site and our mobile applications may contain (or you may be sent through the site or our mobile application) links to other websites or content belonging to or origination from third parties or links to websites and features in banners or other accuracy. Such external links are not investigated, monitored, or checked for accuracy, adequacy, validity, reliability, availability or completeness by us. WE DO NOT WARRANT, ENDORSE, GUARANTEE, OR ASSUME RESPONSIBILITY FOR THE ACCURACY OR RELIABILITY OF ANY INFORMATION OFFERED BY THIRD-PARTY WEBSITES LINKED THROUGH THE SITE OR ANY WEBSITE OR FEATURE LINKED IN ANY BANNER OR OTHER ADVERTISING, WE WILL NOT BE A PARTY TO OR IN ANY WAY BE RESPONSIBLE FOR MONITORING ANY TRANSACTION BETWEEN YOU AND THIRD-PARTY PROVIDERS OF PRODUCTS OR SERVICES.</strong></p><p><br></p><p><br></p>', 1, 4, NULL, NULL),
