or or the arbitrators appointed fail to choose a third arbitrator, such arbitrator shall be appointed by NEPCA, failing which shall be appointed in accordance with the laws of Nepal.</strong></li><li><br></li><li><strong>Venue and seat of the arbitration shall be Kathmandu, Nepal.</strong></li><li><br></li><li><strong>The decision of the arbitration shall specify how the expenses of the arbitration shall be allocated between the parties.</strong></li><li><br></li><li><strong>The arbitration award shall be final and binding upon the parties, and decree on such award may be entered in any court having jurisdiction.</strong></li></ol><p><strong>&nbsp;</strong></p><p><strong>Notwithstanding anything mentioned elsewhere in this document, the parties shall have the right to seek injunctive or equitable relief available under applicable laws from the competent courts of Nepal having jurisdiction on the matter thereof.</strong></p><p><strong>&nbsp;</strong></p><p><strong>Changes and amendments</strong></p><p><strong>Urbarbazaar may modify these terms of use relating to the Services at any time, providing an advance notice along with updated version of this agreement. If the terms are modified, the changes will be effective on the date stated in the advance notice. It is Your responsibility to&nbsp;review these Terms and Conditions periodically for updates / changes. If you disagree with any updated version of this agreement, you may stop using the Service immediately. A continued use of the Services after any such changes shall constitute your consent to such changes.</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Acceptance of these terms</strong></p><p><strong>You acknowledge that you have read these terms of use and agree to all its terms and conditions. This is by accessing and using the Services you agree to be bound by this Agreement. This agreement is an electronic record as per&nbsp;Rule 3 of the Electronic Transaction Rules, 2064